import React, { Component } from 'react';
import CellData from './CellData';

export class Table extends Component {
  // constructor(props) {
  //   super(props)
  //   this.state = {
  //     selectedMentor: null,
  //   }
  // }

  // HeadListTasks = (data, mentor) => Object.keys(data.tasks)
  //     .map(item => data.mentors[mentor].students
  //     .map((stud) => {
  //     return (<tr key={data.tasks[item].id}><CellData user={stud} nameClass={stud.tasks[item].className} taskName={item} /></tr>);
  //     })
  //   )

  listTasks = (data, mentor) => 
    Object.keys(data.tasks)
      .map(item => <tr key={data.tasks[item].id}><td>{item}</td>{ data.mentors[mentor].students
        .map((stud) => <CellData key={stud.tasks[item].id} nameClass={stud.tasks[item].className} />
      )}</tr> 
    )
  
  render() {
    let page;
    
    const {data, mentor} = this.props;
    if (data && mentor) {

      //  console.log(this.listTasks(data, mentor));
      // console.log(mentor);

       console.log('data.mentors[mentor]:', Object.keys(data.tasks)
        .map(item => data.mentors[mentor].students.map(stud => stud.tasks[item].className)))
      //  console.log(Object.keys(data.tasks));

       page = this.listTasks(data, mentor);
    }

    else {
      page = 'not data';
    }
    return (
      <table>
        <tbody>
          {page}
        </tbody>
      </table>
    );
  }
}
